import React, { useEffect, useState } from "react";
import "../../assets/styles/MainPage.css";
import axios from "axios";

function MainPage() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    axios.get("/products").then((res) => {
      setProducts(res.data);
    });
  }, []);

  return (
    <div className="main">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-content">
          <h1>New Season Collection</h1>
          <p>Discover the latest trends in fashion for men and women.</p>
          <div className="hero-buttons">
            <button className="btn">Shop Women</button>
            <button className="btn">Shop Men</button>
          </div>
        </div>
      </section>

      {/* Featured Products */}
      <section className="featured-products">
        <h2>Featured Products</h2>
        <div className="products-grid">
          {products.map((product) => (
            <div className="product-card" key={product.id}>
              <img src={product.image} alt={product.name} />
              <h3>{product.name}</h3>
              <p>${product.price}</p>
              <button className="btn-cart">Add to Cart</button>
            </div>
          ))}
        </div>
      </section>

      {/* Women's Collection */}
      <section className="collection women">
        <img src="women-collection.jpg" alt="Women's Collection" />
        <div>
          <h3>Women's Collection</h3>
          <p>Elegant dresses and stylish tops for any occasion.</p>
          <button className="btn">Shop Now</button>
        </div>
      </section>

      {/* Men's Collection */}
      <section className="collection men">
        <div>
          <h3>Men's Collection</h3>
          <p>Stylish options for every day and special occasions.</p>
          <button className="btn">Shop Now</button>
        </div>
        <img src="men-collection.jpg" alt="Men's Collection" />
      </section>

      {/* Newsletter Signup */}
      <section className="newsletter">
        <h3>Subscribe to Our Newsletter</h3>
        <p>Stay updated with our latest collections and offers.</p>
        <form>
          <input type="email" placeholder="Your email address" />
          <button className="btn">Subscribe</button>
        </form>
      </section>

      {/* Footer */}
      <footer className="site-footer">
        <div className="footer-columns">
          <div>
            <h4>TREND TRAIL</h4>
            <p>Curated trendy fashion pieces.</p>
          </div>
          <div>
            <h4>Shop</h4>
            <ul>
              <li>Men</li>
              <li>Women</li>
              <li>New Arrivals</li>
              <li>Sale</li>
            </ul>
          </div>
          <div>
            <h4>Account</h4>
            <ul>
              <li>Login</li>
              <li>Register</li>
              <li>Cart</li>
              <li>Wishlist</li>
            </ul>
          </div>
          <div>
            <h4>Contact</h4>
            <p>123 Fashion St, Styleville</p>
            <p>+1 (555) 123-4567</p>
            <p>info@trendtrail.com</p>
          </div>
        </div>
        <p className="footer-copy">
          © 2025 Trend Trail Boutique. All rights reserved.
        </p>
      </footer>
    </div>
  );
}

export default MainPage;
